from type_checking import *
from tqdm.auto import tqdm
class MinimalHeightTrees:
    def findMinHeightTrees(self, n: int, edges: List[List[int]]) -> List[int]:
        from collections import deque
        maxheights=[None for i in range(n)]
        neighborsdic=dict()
        for edge in edges:
            for idx in range(2):
                if not neighborsdic.get(edge[idx]):
                    neighborsdic[edge[idx]] = {edge[1-idx]}
                else:
                    neighborsdic[edge[idx]].add(edge[1-idx])
        # print(neighborsdic)
        for node in tqdm(range(n)):
            # print(f"current node: {node}")
            # print("\n\n")
            visited=set()
            queue=deque([node])
            distanceFrom=[None for i in range(n)]
            distanceFrom[node]=0
            longdis = 0
            while queue:
                # print(f"current queue: {queue}")
                cur = queue.popleft()
                visited.add(cur)
                for neighbor in neighborsdic[cur]:
                    if neighbor not in visited:
                        queue.append(neighbor)
                        visited.add(neighbor)
                        distanceFrom[neighbor] = distanceFrom[cur] +1
                        if distanceFrom[neighbor] > longdis:
                            longdis = distanceFrom[neighbor]

            maxheights[node]=longdis

        return [idx for idx in range(n) if maxheights[idx] ==min(maxheights)]

    def findMinHeightTreesFaster(self, n: int, edges: List[List[int]]) -> List[int]:
        """
        1.random choose node 0 and find longest path starting from 0, suppose the end idx =x
        2.starting from x, find the longest path
        3. center of the longest path in the second step should be the node we want(either one node or two)
        """
        from collections import deque
        neighborsdic=dict()
        for edge in edges:
            for idx in range(2):
                if not neighborsdic.get(edge[idx]):
                    neighborsdic[edge[idx]] = {edge[1-idx]}
                else:
                    neighborsdic[edge[idx]].add(edge[1-idx])

        numBFS,curidx=0,0
        while numBFS<=1:
            queue=deque([curidx])
            path = dict()
            longdis,longIdx = 0,None
            visited=set()
            distanceFrom=[None for i in range(n)]
            while queue:
                distanceFrom[curidx]=0
                cur = queue.popleft()
                visited.add(cur)
                for neighbor in neighborsdic[cur]:
                    if neighbor not in visited:
                        queue.append(neighbor)
                        visited.add(neighbor)
                        distanceFrom[neighbor] = distanceFrom[cur] +1
                        path[neighbor] = cur
                        if distanceFrom[neighbor] > longdis:
                            longdis = distanceFrom[neighbor]
                            longIdx = neighbor
            print(longIdx,longdis)
            curidx=longIdx
            numBFS +=1
        layers= int(longdis/2)
        numSteps,curNode=0,longIdx
        while numSteps <layers:
            curNode = path[curNode]
            numSteps +=1
        if longdis%2==0:
            return [curNode]
        else:
            return [curNode,path[curNode]]











